visited = []
res = 0


def explore(i, j, c, visited):
    visited.append((i, j))
    p = 0
    a = 1
    if i < len(themap) - 1 and themap[i + 1][j] == c:
        if (i + 1, j) not in visited:
            a1, p1 = explore(i + 1, j, c, visited)
            a += a1
            p += p1
    else:
        p += 1
    if i > 0 and themap[i - 1][j] == c:
        if (i - 1, j) not in visited:
            a1, p1 = explore(i - 1, j, c, visited)
            a += a1
            p += p1
    else:
        p += 1
    if j > 0 and themap[i][j - 1] == c:
        if (i, j - 1) not in visited:
            a1, p1 = explore(i, j - 1, c, visited)
            a += a1
            p += p1
    else:
        p += 1
    if j < len(themap[i]) - 1 and themap[i][j + 1] == c:
        if (i, j + 1) not in visited:
            a1, p1 = explore(i, j + 1, c, visited)
            a += a1
            p += p1
    else:
        p += 1
    return a, p


for i, line in enumerate(themap):
    for j, c in enumerate(line):
        if (i, j) not in visited:
            a, p = explore(i, j, c, visited)
            res += a * p

print(res)
